import axios from 'axios'
import env from '@/env'

export default {
	getContestWithAccessCode(obj) {
		return axios({
			method: 'POST',
			url: env.apiUrl+'quiz/access_code',
			headers: env.publicHeader,
			data: obj
		})
	},
	registerUser(obj) {
		return axios({
			method: 'PUT',
			url: env.apiUrl + 'participant',
			headers: env.publicHeader,
			data: obj
		})
	},
	getQuestion(obj) {
		return axios({
			method: 'POST',
			url: env.apiUrl + 'question',
			headers: env.publicHeader,
			data: obj
		})
	},

	submitAnswer(obj) {
		return axios({
			method: 'PUT',
			url: env.apiUrl + 'participant/response',
			headers: env.publicHeader,
			data: obj
		})
	},
	getWinners(obj) {
		return axios({
			method: 'POST',
			url: env.apiUrl + 'quiz/winners',
			headers: env.publicHeader,
			data: obj
		})
	},


}
